// SPDX-License-Identifier: MIT
pragma solidity >=0.5.0 <0.9.0;

contract Transactions {
    struct Transaction {
        uint256 id;
        uint256 date;
        string buyer;
        string seller;
        string ornumber;
        string total;
        string cid;
        address sender;
        string items;
    }

    Transaction[] public transactions;
    uint256 public idCounter;

    function addTransaction(
        string memory _buyer,
        string memory _seller,
        string memory _ornumber,
        string memory _total,
        uint256 _date,
        string memory _cid,
        address _sender,
        string memory _items
    ) public {
        uint256 _id = idCounter++;

        Transaction memory newTransaction = Transaction({
            id: _id,
            date: _date,
            buyer: _buyer,
            seller: _seller,
            ornumber: _ornumber,
            total: _total,
            cid: _cid,
            sender: _sender,
            items: _items
        });

        transactions.push(newTransaction);
    }

    function getTransaction(
        uint256 _index
    )
        public
        view
        returns (
            uint256 id,
            uint256 date,
            string memory buyer,
            string memory seller,
            string memory ornumber,
            string memory total,
            string memory cid,
            string memory items
        )
    {
        require(
            _index < transactions.length,
            "Transaction index out of bounds."
        );
        Transaction storage transaction = transactions[_index];

        return (
            transaction.id,
            transaction.date,
            transaction.buyer,
            transaction.seller,
            transaction.ornumber,
            transaction.total,
            transaction.cid,
            transaction.items
        );
    }

    function getAllTransactions() public view returns (Transaction[] memory) {
        return transactions;
    }

    function getTransactionsByDateAndSender(
        uint256 _from,
        uint256 _to,
        address _sender
    ) public view returns (Transaction[] memory) {
        uint256 numTransactions = 0;
        uint256 startOfDay = (_from / 86400) * 86400; // Round down to start of day
        uint256 endOfDay = ((_to + 86399) / 86400) * 86400; // Round up to end of day
        for (uint256 i = 0; i < transactions.length; i++) {
            if (
                transactions[i].date >= startOfDay &&
                transactions[i].date <= endOfDay &&
                transactions[i].sender == _sender
            ) {
                numTransactions++;
            }
        }

        Transaction[] memory result = new Transaction[](numTransactions);
        uint256 index = 0;
        for (uint256 i = 0; i < transactions.length; i++) {
            if (
                transactions[i].date >= startOfDay &&
                transactions[i].date <= endOfDay &&
                transactions[i].sender == _sender
            ) {
                result[index] = transactions[i];
                index++;
            }
        }

        return result;
    }

    function getTransactionsBySender(
        address _sender
    ) public view returns (Transaction[] memory) {
        uint256 numTransactions = 0;
        for (uint256 i = 0; i < transactions.length; i++) {
            if (transactions[i].sender == _sender) {
                numTransactions++;
            }
        }

        Transaction[] memory result = new Transaction[](numTransactions);
        uint256 index = 0;
        for (uint256 i = 0; i < transactions.length; i++) {
            if (transactions[i].sender == _sender) {
                result[index] = transactions[i];
                index++;
            }
        }

        return result;
    }
}
